export default function HomeScreen() {
    return (
      <View style={{ flex: 1, alignItems: 'center', justifyContent: 'center' }}>
        <ImageBackground source={require('../assets/images/background.png')} style={{width: '100%', height: '100%'}}/>
      </View>
    );
}
